import React from "react";

const Menu = ({ items }) => {
  return (
    <div className="section-center">
      {items.map((menuItem) => {
        const { id, title, desc, price, img } = menuItem;
        return (
          <div className="" key={menuItem.id}>
            <div className=""></div>
          </div>
        );
      })}
    </div>
  );
};

export default Menu;
